import React from 'react';
import Breadcrumbs from '../components/Breadcrumbs';
import { Slide } from 'react-reveal';

const Contact = () => {
  return (
      <>
        <Slide 
          bottom 
          big
          duration={500}
        >
          <h1>Contact</h1>
          <Breadcrumbs />
        </Slide>

      </>
  )
};

export default Contact;
